import "./Roster.scss";

export default function Roster() {
  return (
    <section className="roster section">
      <div className="panel one">one</div>
      <div className="panel two">two</div>
      <div className="panel three">three</div>
      <div className="panel four">four</div>
    </section>
  );
}
